import React from 'react';
import './PlayerReviews.css';

const PlayerReviews = ({ reviews }) => {
  return (
    <div className="reviews">
      <h2>Reseñas</h2>
      <p>El mejor de la Historia⭐⭐⭐⭐⭐</p>
      <p>⭐⭐⭐⭐</p>
      {/* Añade más reseñas según sea necesario */}
    </div>
  );
};
export default PlayerReviews;
